campaignTrail_temp.questions_json = JSON.parse("[{\"model\": \"campaign_trail.question\", \"pk\": 717, \"fields\": {\"priority\": 1, \"description\": \"January 2021: After Merkel's announcement of retirement, her initial handpicked successor, Annegret Kramp-Karrenbauer, has faltered in just 3 years. Instead, the CDU has just elected North Rhine-Westphalian Minister President Armin Laschet as their new party leader. Politicians across the political spectrum are congratulating him. As leader of the smaller Bavarian sister party, CSU, what do you want to say?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 718, \"fields\": {\"priority\": 1, \"description\": \"It’s clear to you that Laschet is a weak candidate, a weak leader. Many expect you to challenge him - it might finally be time for a Bavarian chancellor. Privately, you’re up for it - but coming out with it now would be hasty. To grow your influence in the party and the country, what will be your course of action over the next few months.\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 719, \"fields\": {\"priority\": 1, \"description\": \"March 2021: COVID-19 has shaped the lives of people in Germany and across the world for the past years. Now that the winter is over, a lot of people are demanding an end to the harsh lockdowns. As Minister-President of Bavaria, you could chart a new course for your government. What is your stance on this?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 720, \"fields\": {\"priority\": 1, \"description\": \"You’ve been invited to a talk show to talk about tax policy and the “Black Zero”, which mandates a balanced budget. The left and left-of-center seek more investments, paid for by taxing the rich, while the FDP seeks widespread tax reductions. How do you want to frame the position of your party?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 721, \"fields\": {\"priority\": 1, \"description\": \"Irritated, you read the headline of the 11/2021 issue of<i> Der Spiegel</i>: <br>” <i>‘Schwarzer Filz’ - Mask deals, venality, failure in crisis: the deep fall of the Union. </i> “<br>They reveal how several CDU/CSU MPs are implicated as part of a corrupt scheme to sell overpriced medical masks to government organizations, in order to profit from the crisis. Journalists run in your door, asking for a comment on this crisis, especially as several Bavarian politicians are involved.\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 722, \"fields\": {\"priority\": 1, \"description\": \"April 2021: It’s getting serious. Minister of Finance and current Vice Chancellor Olaf Scholz has been declared chancellor candidate by the SPD last year already and there are rumors the Green party is about to nominate either Annalena Baerbock or Robert Habeck next. It’s clear that Laschet is looking to announce his candidacy soon as well - now might be the time to strike. How do you want to go about challenging the CDU leader?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 723, \"fields\": {\"priority\": 1, \"description\": \"You and Armin Laschet both want to become the chancellor candidate for the Union of CDU/CSU, in an intra-party competition not seen since 2002. Back then, your predecessor Stoiber won out against Merkel, but lost in the general election. These days, while Laschet has the bully pulpit as leader of the national party, popular opinion polls show you ahead. How do you want to go about settling this?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 724, \"fields\": {\"priority\": 1, \"description\": \"You’ve done it. The Union has accepted you as their candidate - Laschet retreats with his tail between his legs, and you stand victorious. <br> Of course, you never really doubted this outcome - but it still feels good to finally have taken over as the 3rd CSU candidate for chancellor, to follow up on Merkel's leadership. Congratulations! What talking point do you want to hit on at the press conference?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 725, \"fields\": {\"priority\": 1, \"description\": \"The Green party has, for the first time in its history, nominated a chancellor candidate, party leader Robert Habeck. In a development few would have expected four years ago, he appears to be your main contender, selectively polling even with you, while Olaf Scholz of the SPD seems far behind in third place. What’s your strategy regarding your two opponents?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 726, \"fields\": {\"priority\": 1, \"description\": \"Michael Kretschmer, your party colleague and Minister-President of Saxony, has recently traveled to Moscow and has been criticized for that visit. Additionally, your own trip to Moscow last year is scrutinized by the media as well. What’s your stance on current policies regarding Germany’s relationship with Russia and Putin?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 801, \"fields\": {\"priority\": 1, \"description\": \"You’re invited to a talk show about immigration and refugees. Although tempers have cooled a bit since 2015, the discussion around Merkel's decision to welcome the refugees 6 years ago is still relevant - particularly for the AfD, who got driven into parliament on this issue in 2017. Germany is still a popular destination for many foreigners seeking a better life, yet the nation does not seem prepared for this. What stance do you take in this debate?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 727, \"fields\": {\"priority\": 1, \"description\": \"May 2021: A bombshell has rocked the Grand Coalition: the Federal Constitutional Court just ruled the Climate Protection Act unconstitutional and demands the government do more to lower emissions. Berlin has already gone to work on making the law stricter. What is your opinion on this issue?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 802, \"fields\": {\"priority\": 1, \"description\": \"Up until now, your campaign has been dominated by a very centrist attitude, tilting center-left even. To many, this seems evocative of Angela Merkel, but some party cadres, particularly around Friedrich Merz, are worried about their core values. In an internal meeting, you’re asked frankly: do you plan to keep this up?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 728, \"fields\": {\"priority\": 1, \"description\": \"More and more people are receiving a Covid vaccine, though not everyone has been granted access yet. Older people and those in critical professions are starting to get the shot, while some who are younger are frustrated to wait. Do you have a comment on how to move forward with the vaccination campaign?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 729, \"fields\": {\"priority\": 1, \"description\": \"You have been invited to give a speech about German foreign and defense policy. Members of the Bundeswehr stand in the crowd: they eagerly listen to what direction you want Germany to take on the world stage. Which talking points do you emphasize?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 803, \"fields\": {\"priority\": 1, \"description\": \"One salient issue is the topic of pensions, particularly in light of Germany's changing demographics. Currently, pensions are distributed from a fund financed by the current working populace. However, because the number of retirees seems to grow faster than the workforce, the system is thought to be unsustainable. How do you want to address this problem?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 730, \"fields\": {\"priority\": 1, \"description\": \"June 2021: As the campaign is heating up, you and Robert Habeck are locked in a tense race, with Olaf Scholz in a distant third. However, there does seem to be light on the horizon: The CDU turns out to be the big winner at the provincial elections in Saxony-Anhalt, with Minister-President Reiner Haselhoff’s popularity being credited. What’s your reaction to this information?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 804, \"fields\": {\"priority\": 1, \"description\": \"In a twist no one foresaw 4 years ago, the Greens seem to have superseded the SPD as the main center-left party in this election. Party leader, former Schleswig-Holstein Minister of the Environment Robert Habeck was chosen as the Green’s first chancellor candidate, and has pulled even and ahead of you in selective polls. As he’s seemingly your main opponent, how do you want to stunt his momentum?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 731, \"fields\": {\"priority\": 1, \"description\": \"Digitalization is an important topic in this election, with Germany often perceived as surprisingly archaic in comparison to its neighbors, frequently seen on the tail end of statistics. With all parties unveiling plans to rectify this, what focus do you want to lay?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 805, \"fields\": {\"priority\": 1, \"description\": \"One of the more salient issues in the current political landscape across the western world is the question of rents, particularly for younger voters. Most economic and educational opportunities increasingly lie in the big cities of the country - where rent is constantly increasing, to the point where it becomes a serious political question. What is your answer to the housing question?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 732, \"fields\": {\"priority\": 1, \"description\": \"July 2021: Catastrophe hits. The meteorological low-pressure area <i>Bernd</i> has hit Central Europe and made several rivers burst over their banks. Disastrous rain and floods are affecting large areas of Germany.  Bavaria is among the affected states and pictures of the destruction in other states dominate the news. You are asked to comment.\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 733, \"fields\": {\"priority\": 1, \"description\": \"Post-flood cleanup operations are going on as the full devastation of the flooding becomes clear: 220 fatalities, 186 of those in Germany, the deadliest flood since 1962.<br>Among the mourning, many advisors urge you to get out and show yourself as a man of action, to capitalize on the clean-up efforts.\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 734, \"fields\": {\"priority\": 1, \"description\": \"Climate change is a much-discussed topic again after the floods - it seems dire warnings of extreme weather events are starting to come true. In the wake of this, you have been asked if this had an impact on your stance on how to best combat climate change.\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 735, \"fields\": {\"priority\": 1, \"description\": \"After early successes, the vaccination campaign has become sluggish in recent weeks. Most vulnerable groups have been taken care of, but some vaccine-critical or lethargic people have been on the holdout for their shot. Some media figures are now going as far as to demand making the vaccine mandatory. What do you think of this?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 736, \"fields\": {\"priority\": 1, \"description\": \"August 2020: With the campaign heating up, there have been some attacks on you and your party - a big target is CSU Minister of Transportation Andreas Scheuer. The CSU had promised a “Maut”, highway tolls for foreigners, but the project failed spectacularly and might cost millions of Euros still, due to interference from the EU courts. Scheuer was widely blamed for the whole affair. As party leader, you’re asked: what went wrong?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 806, \"fields\": {\"priority\": 1, \"description\": \"A bit of a minor issue, but one that has gripped the imagination of many young voters is the topic of cannabis. Currently, it is a controlled substance, and illegal to produce, distribute or own. In light of worldwide movements to decriminalize or even legalize it: <i>Wann Bubatz legal</i>?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 737, \"fields\": {\"priority\": 1, \"description\": \"There are 7 parties poised to enter parliament, and none has ever won an absolute majority since Adenauer in 1957. As such, it is basically guaranteed that there will be a coalition government after the elections. You are asked ad-nauseam - who would you enter a coalition with?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 807, \"fields\": {\"priority\": 1, \"description\": \"A defining social issue is the question of abortion. Currently, criminal law §218 disallows abortions generally, but decriminalizes them in case of rape, or if the pregnancy is under 12 weeks old. Additionally, §219a establishes an “ad ban” for doctors offering abortions. You’re asked for your stance on this controversial topic.\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 738, \"fields\": {\"priority\": 1, \"description\": \"September 2021: Pictures of the disastrous retreat of NATO troops from Afghanistan go around the globe. Many loyal locals are left behind, as the Taliban are poised to make a comeback. The government is sharply criticized for its botched evacuation - what stance do you want to take?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 739, \"fields\": {\"priority\": 1, \"description\": \"September 2021: Official TV debates are a relatively recent phenomenon in Germany, only being consistently organized since 2002. Now, for the first time in German history, there will be a three-way debate, a so-called “Triell”. You, Olaf Scholz and Annalena Baerbock are all invited. What is going to be your strategy?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 740, \"fields\": {\"priority\": 1, \"description\": \"During the Triell, you decided to focus on Olaf Scholz, vice chancellor and candidate of the SPD. What do you want to attack him on?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 808, \"fields\": {\"priority\": 1, \"description\": \"Along with the <i> Triell </i>, another TV debate is commonly held among surrogates of the smaller parties; the so-called <i> Vierkampf </i>. While the Greens have seemingly eclipsed the other Bundestag parties, it’s Janine Wissler of Die Linke, Christian Lindner of the FDP, Alice Weidel of the AfD and Paul Ziemiak of the CDU (since the CSU is heading the Union ticket through you), debating about the issues of the day.\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 743, \"fields\": {\"priority\": 1, \"description\": \"The 26th of September is almost here. Finally, this historically important campaign is coming to an end. Hopefully, your ambitions of becoming Germany’s first Bavarian chancellor can finally come to fruition! In your final lap for this year, you have a chance to get some support from a political ally. Who do you want to campaign with?\", \"likelihood\": 1.0}}]");
extraQuestions = JSON.parse("[{\"model\": \"campaign_trail.question\", \"pk\": 741, \"fields\": {\"priority\": 1, \"description\": \"During the Triell, you decided to focus on Robert Habeck, chancellor candidate of the Green party. What do you want to attack him on?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 742, \"fields\": {\"priority\": 1, \"description\": \"During the Triell, you decided to take the high road, and focus on making your case to the German people without mudslinging. There are many policies in the CDU/CSU programs, and you can employ different strategies of presenting yourself to the audience. How do you want to do that?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 744, \"fields\": {\"priority\": 1, \"description\": \"You and Armin Laschet both want to become the chancellor candidate for the Union of CDU/CSU, in an intra-party competition not seen since 2002. Back then, your predecessor Stoiber won out against Merkel, but lost in the general election. These days, while Laschet has the bully pulpit as leader of the national party, popular opinion polls show you ahead. How do you want to go about settling this?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 745, \"fields\": {\"priority\": 1, \"description\": \"You and Armin Laschet both want to become the chancellor candidate for the Union of CDU/CSU, in an intra-party competition not seen since 2002. Back then, your predecessor Stoiber won out against Merkel, but lost in the general election. These days, while Laschet has the bully pulpit as leader of the national party, popular opinion polls show you ahead. How do you want to go about settling this?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 809, \"fields\": {\"priority\": 1, \"description\": \"Up until now, your campaign has embraced a classical moderate-conservative Christian Democracy, mostly following the center-right party doctrine. Some advisors want you to pivot further left towards the median voter, while others want you to take the AfD’s wind out of their sails. In an internal meeting, you’re asked frankly: do you plan to keep this up?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 810, \"fields\": {\"priority\": 1, \"description\": \"Up until now, your campaign has been met with a surprisingly hardline-conservative tone,  seemingly wanting to take the party rightwards, quite evocative of the typical CSU rhetoric during Merkel. In an internal meeting, you’re asked frankly: do you plan to keep this up?\", \"likelihood\": 1.0}}]");
campaignTrail_temp.answers_json = JSON.parse("[{\"model\": \"campaign_trail.answer\", \"pk\": 4000, \"fields\": {\"question\": 717, \"description\": \"I will offer my congratulations to Armin Laschet, for winning the leadership competition. Together, we will keep writing the success story of the CDU/CSU. I’m looking forward to a close cooperation.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4001, \"fields\": {\"question\": 717, \"description\": \"Publicly, I of course want to congratulate him for winning the leadership election, to not rock any boats in the partnership of our parties. However, I’m worried that a guy like him will lose us the election in the fall. Behind the scenes, I will prepare my strike for what really counts: the chancellor candidacy.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4002, \"fields\": {\"question\": 717, \"description\": \"Of course I will congratulate him. However, I want to make it clear that him being party leader does not automatically make him chancellor candidate. I’ll make some remarks that we will have to sort this question out later.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4003, \"fields\": {\"question\": 717, \"description\": \"First, I want to congratulate him publicly. At the same time, let’s reach out to some of the people who supported his opponents in the leadership election and start convincing them that I am the better chancellor candidate. I know that Norbert Röttgen made some veiled overtures to me..\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4004, \"fields\": {\"question\": 718, \"description\": \"I’m already quite well known among the German people, but it’s time to give my profile a boost, so that people think of me instead of him when talking about Christian Democracy. Let’s go to every talk show that wants to have me and make sure people see my face constantly.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4005, \"fields\": {\"question\": 718, \"description\": \"My polling is better than Laschets, but the chancellor candidacy isn’t a popularity contest: it’s about connections. I will speak with as many CDU functionaries as I can in the coming weeks, to start getting them on my side. I know our youth organization JU is quite receptive to me.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4006, \"fields\": {\"question\": 718, \"description\": \"I’m already the darling of our party base. The CDU leadership will have to acknowledge this, and pick me over Laschet. Right now, I want to start focusing on the general election and attack the SPD and the Greens whenever an opportunity presents itself. As someone not intricately involved in Merkel's administration, I‘m able to make a good attack dog.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4007, \"fields\": {\"question\": 718, \"description\": \"It would probably backfire if I were to personally attack the CDU, so I will do nothing of the sort. However, I’m sure there are plenty of CSU politicians who can find things to be critical of. I will talk to my party behind the scenes to lead the push against Laschet as the Unions candidate.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4008, \"fields\": {\"question\": 719, \"description\": \"I’ve been known as a lockdown hardliner in the past. However, it’s clear people are starting to grumble - the situation in Bavaria is quite good compared to other states, so we should be able to loosen up our measures and open up fairly quickly. We’re a Free State, not a Constraint State.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4009, \"fields\": {\"question\": 719, \"description\": \"The situation is still very volatile, so I will keep doing what I’ve been doing for the whole pandemic so far and stay on a hard line against Covid. There will be no premature openings in Bavaria.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4010, \"fields\": {\"question\": 719, \"description\": \"Throughout the pandemic, people have looked to me for leadership even outside of Bavaria and I have to maintain my outsized role in this discourse. I will call for whatever seems more popular at the moment: Bavaria as the land of Caution, Bavaria as the land of Proportionality, Bavaria as the land of Freedom… any way the wind blows.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4011, \"fields\": {\"question\": 719, \"description\": \"I support Armin Laschet's proposal of a bridge lockdown over Easter, until enough people are vaccinated. I’ve always been in support of measures like this, and so has the chancellor.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4012, \"fields\": {\"question\": 720, \"description\": \"Under no circumstances will we raise taxes, but we don’t want to dramatically lower them either. We will phase out the extra tax of the Soli and try to reduce the burden on small and medium-income earners while always keeping the budget balanced, in keeping with the “Black Zero”.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4013, \"fields\": {\"question\": 720, \"description\": \"The Covid crisis has left a massive hole in our budget that we have to plug somehow. We have to be measured, but a tax increase will likely be unavoidable to avoid harsh debts that can hurt our economy even further.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4014, \"fields\": {\"question\": 720, \"description\": \"Taxes for private households should stay where they are or even be lowered by phasing out the Soli. More importantly, corporate taxes should be lowered to unleash the full economic potential of this country. As little State as necessary, as much market as possible.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4015, \"fields\": {\"question\": 720, \"description\": \"The most important thing we can do now is lower the taxes for small and medium-income earners, our tax policy is failing them. Besides that, I’ll mainly attack the tax plans of the other parties.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4016, \"fields\": {\"question\": 721, \"description\": \"I’m as shocked and outraged as everyone else when this came to light. There will be new rules for members of my party that they have to make all earnings public, to prevent something like this from happening again.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4017, \"fields\": {\"question\": 721, \"description\": \"Let’s wait and see how this develops. I’ll issue a brief statement that we want to wait until it’s clear what actually happened. Luckily, it seems like the CDU is in more trouble than the CSU, so maybe I can use this to paint me as a more competent party leader.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4018, \"fields\": {\"question\": 721, \"description\": \"This is nothing but a political hit job by a left-wing magazine in an election year. I’m sure further investigations will prove the innocence of these MPs.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4019, \"fields\": {\"question\": 721, \"description\": \"We have to deflect from this as much as possible. I will make it clear that I have zero tolerance for corruption, but I will refrain from any incendiary statements. I don’t want to get associated with this personally.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4020, \"fields\": {\"question\": 722, \"description\": \"I have to be careful here, I don’t want to come across as too power-hungry. First, I will call Laschet and tell him that I think a challenge would be best for the party, and then tentatively acknowledge my ambitions to the media.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4021, \"fields\": {\"question\": 722, \"description\": \"It’s an open secret my true goal is the chancellor candidacy. Let’s not beat around the bush -  let’s make an announcement as soon as possible to catch Laschet by surprise. If he has to catch up, we can paint him in an even worse light.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4022, \"fields\": {\"question\": 722, \"description\": \"Doing this the wrong way could backfire - my appeal lies in my popularity, so let’s work through that. I’ll have my supporters in the CDU and CSU demand that I save the party from Laschet's bad polling numbers, and then - “reluctantly” - declare my candidacy.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4023, \"fields\": {\"question\": 723, \"description\": \"Now, it’s time for payoff. I’m sure Laschet will try to force a vote by the party elites - I’m going to welcome this, he’ll be surprised by how much support I have even among them. If even the upper CDU echelons stand with me against him, there will be nothing in my way.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4024, \"fields\": {\"question\": 723, \"description\": \"During the next few days, I will hammer my main argument again and again - I have the better polling numbers, and I’m the one who can lead the CDU/CSU to victory in the fall. I   will showcase several district candidates who are already distancing themselves from Laschet. He would lose, him and the rest of the party have to accept this.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4025, \"fields\": {\"question\": 723, \"description\": \"The party parliamentary group of CDU and CSU shall vote on this. They want to get reelected - with my strong numbers, I’m confident they’ll see me as the better option and pick me over Laschet.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4026, \"fields\": {\"question\": 723, \"description\": \"The party parliamentary group of CDU and CSU shall vote on this. They want to get reelected - with my strong numbers, I’m confident they’ll see me as the better option and pick me over Laschet.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4027, \"fields\": {\"question\": 724, \"description\": \"First and foremost, I want to thank Armin Laschet for this fair competition. I want to plead for a united Union, to continue our successful governance of Germany. Apart from that, I will hit my usual talking points.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4028, \"fields\": {\"question\": 724, \"description\": \"If you want to look at how I want to govern this country, look at Bavaria. We are one of the most successful states by a big number of metrics and my popularity there speaks for itself. As an accomplished leader of the Free State, Germany will shine just as bright.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4029, \"fields\": {\"question\": 724, \"description\": \"It’s clear that the two most important topics this election are Covid and climate change. I will guide Germany through the pandemic like I guided Bavaria, and I will make sure our transition to renewable energies goes along smoothly. I will continue to lead Germany into the modern age and pull us through the challenges we’re facing.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4030, \"fields\": {\"question\": 724, \"description\": \"Merkel has been a respected leader for these last 16 years, and I will do my best to follow in her path and continue her successful stewardship of our beloved country.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4031, \"fields\": {\"question\": 725, \"description\": \"The Green party is always surging a few months before elections and comes crashing down in time, just like in 2011 after Fukushima. I’m not too worried - we should still focus more on competing with the SPD, our traditional opponent.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4032, \"fields\": {\"question\": 725, \"description\": \"I will take this development very seriously, clearly the demand is there to act on climate change. Let’s unveil some of our own sensible and realistic environmental policies, piece by piece, to catch media attention away from them and stop their momentum.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4033, \"fields\": {\"question\": 725, \"description\": \"Off the record, it’s not the worst thing that these two parties compete for center-left votes. This makes the path to first place a lot easier. Let’s focus somewhat on the Greens as our main contender in that regard, and just attack them moderately where we can.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4034, \"fields\": {\"question\": 725, \"description\": \"Actually, this is a bit ridiculous and reminds me of the publicity stunt the FDP pulled in 2002 when they nominated Guido Westerwelle as chancellor candidate. Let’s mock them for their hubris and don’t refer to Habeck as a legitimate chancellor candidate.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4035, \"fields\": {\"question\": 726, \"description\": \"It is important that we don’t demonize Putin and keep our dialogue open. I’m critical of many things the Russian leadership has done, but overall, we should strive to cooperate with them, as we do on the Nord-Stream 2 pipeline.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4036, \"fields\": {\"question\": 726, \"description\": \"I’ve been more lenient in the past, but enough is enough. I will join in with the criticism against Kretschmer and call for a tougher stance towards Putin. Maybe we should only open the Nord-Stream 2 pipeline if we get some concessions from Russia.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4037, \"fields\": {\"question\": 726, \"description\": \"Kretschmer is completely right, we have to talk more with Russia, not less. I’m all in favor of more dialogue and stronger economic ties with Russia. Putin is reasonable and can be talked to, as I did last year!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4038, \"fields\": {\"question\": 726, \"description\": \"This whole thing is overblown, this trip was mostly for cultural exchange. I don’t have much to say about this. We stand on our commitment to Nato.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4501, \"fields\": {\"question\": 801, \"description\": \"In hindsight, Merkel’s decision seems right to me, we needed to take those people in to prevent a humanitarian catastrophe at the Austrian-Hungarian border. Today though, we need to be more mindful of European border security. To that end, we want to strengthen the EU border enforcement agency Frontex.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4502, \"fields\": {\"question\": 801, \"description\": \"There’s no way around it - Germany is an immigration country. We need a comprehensive overhaul of our immigration laws - we don’t have a good system in place to attract qualified immigrants, who could be advantageous to our economy and demographic situation.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4503, \"fields\": {\"question\": 801, \"description\": \"Merkel was absolutely right to take in these people. We’re saying: Refugees Welcome! As a western country partially responsible for colonialism, we have a responsibility for humanitarian aid, including initiatives to rescue capsized refugee boats in the mediterranean.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4504, \"fields\": {\"question\": 801, \"description\": \"On this issue, Merkel has erred - her rhetoric was dangerous in provoking even more refugees and immigrants to come here. We simply can’t take everyone. We need more border security in the EU and faster deportation processes to avoid another disaster - 2015 can’t repeat itself.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4039, \"fields\": {\"question\": 727, \"description\": \"This was a bad decision by the court. The Climate Protection Act already went far enough and I’m not in favor of hurting the economy with a stricter climate policy. We need to look out for our personal and economic freedoms, fear is not the answer.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4040, \"fields\": {\"question\": 727, \"description\": \"I’ve always been an advocate for doing more against climate change. While this has not been mandated by the court, we will also rework our regional Climate Protection Act in Bavaria, to make sure we are doing enough.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4041, \"fields\": {\"question\": 727, \"description\": \"We have to become carbon neutral long before 2050. I’m sure the government under Merkel will come up with a sensible solution, which I will continue as chancellor.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4042, \"fields\": {\"question\": 727, \"description\": \"With the decision by the court, we now have the great opportunity to have an ambitious new Climate Protection Act. Bavaria is on its way to becoming carbon-neutral by 2040, and the whole country should be put on a similar path.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4505, \"fields\": {\"question\": 802, \"description\": \"Yes, I do. Accepting the scientific consensus on climate change and advocating for modern policies is what makes Bavaria so successful - to modernize the whole Union, we have to recalibrate our attitude towards climate action and protecting our social safety net. The CDU/CSU are innovative parties of the 21st century, and I will not let myself get intimidated by right-wing demagogues.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4506, \"fields\": {\"question\": 802, \"description\": \"I do not think in ideological categories, I’m simply standing for what I think is good for Germany. The CDU is the party of good governance - not radicalism, both leftist or rightist.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4507, \"fields\": {\"question\": 802, \"description\": \"I wanted to begin this campaign by bringing us all together - now we can try to tilt the discourse rightwards, taking Merkel supporters with us while framing our conservative positions as more reasonable.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4043, \"fields\": {\"question\": 728, \"description\": \"We need to open up quickly for vaccinated people. A return to normalcy has never been so close, and we all had more than enough of lockdowns - not every measure might still be proportionate. Vaccinated people have less risk and thus should receive more benefits.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4044, \"fields\": {\"question\": 728, \"description\": \"In Bavaria, we are deciding to be on the safe side, consciously. Of course, freedom will only be possible through vaccinations - but I’m particularly worried about these mutations. Opening up too quickly here can be a dangerous combination. Instead, we need to broadly spend more money to buy more from several vaccine producers.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4045, \"fields\": {\"question\": 728, \"description\": \"It’s important that as many people as possible get vaccinated as quickly as possible so we can overcome this crisis. We have to think of measures to get more people vaccinated, like organizing mobile vaccination teams in supermarkets and ending the priority system.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4046, \"fields\": {\"question\": 728, \"description\": \"The vaccine seems helpful now, but we haven’t had a chance to study its side effects yet. We should be mindful of our bodily health and not be too quick in our judgment - I advocate for a slowdown of the vaccination campaign until we have more information.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4047, \"fields\": {\"question\": 729, \"description\": \"For years and years, we have consistently missed the NATO aim to spend 2% of our gross domestic product on defense. I strongly reaffirm our commitment to NATO and this goal! The West has to be united against potential threats.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4048, \"fields\": {\"question\": 729, \"description\": \"While I strongly reaffirm our support of a united Alliance and strong defense, I specifically want to call out Robert Habeck. He did not issue a strong endorsement of NATO yet, which is not appropriate for a chancellor.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4049, \"fields\": {\"question\": 729, \"description\": \"I want to praise the work we’ve done so far and believe we are in a good spot. While I strongly reaffirm my commitment to NATO, we don’t need to spend more on defense than we do right now; we need to combat waste first and foremost.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4050, \"fields\": {\"question\": 729, \"description\": \"NATO is a relic of the cold war. We should stay a member for now, but we should also try to find avenues for cooperating with other nations, keep reaffirming our neutrality, and open up new dialogues with Russia or China, as I did with my visit to Moscow last year.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4508, \"fields\": {\"question\": 803, \"description\": \"The heart of this problem lies in Germany's low birth rates. We need to further encourage the founding of families, with benefits for married and childbearing couples. Family-friendly policies will strengthen our social cohesion and collective values and invest in our future.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4509, \"fields\": {\"question\": 803, \"description\": \"A sustainable answer to keep our social support net afloat lies in immigration. We are an attractive place in Europe for many seeking a safe and economically secure future, and we should finally implement a real immigration law, for example with a Canada-style point-system.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4510, \"fields\": {\"question\": 803, \"description\": \"It's clear that the current system is unsafe. We should build on our public pension system, reform the Riester-system, and refrain from raising the pension age any further than 67! We also need to introduce a higher state-provided minimum pension to fight old-age poverty.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4511, \"fields\": {\"question\": 803, \"description\": \"We need to overhaul the bureaucratic costs of the system and listen to the decisions of the advisory councils. The mix of public, occupational and private pension systems contributes to safe pension levels, particularly occupational and private provisions should be strengthened. We can also look at Swedish-style stock-based pension funds.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4051, \"fields\": {\"question\": 730, \"description\": \"I want to congratulate Haseloff for his strong performance. It shows that the citizens still trust the Union to be the best governing party, and we want to emulate his strategy on a national scale.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4052, \"fields\": {\"question\": 730, \"description\": \"Haseloff performed very well, but I want to emphasize that the AfD lost votes. When we keep appealing and listening to all people, without prejudice, we can win them back for the democratic parties.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4053, \"fields\": {\"question\": 730, \"description\": \"This was a very strong performance. To show my gratitude, I will make an extra trip to Saxony-Anhalt and campaign with him for some nice pictures.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4512, \"fields\": {\"question\": 804, \"description\": \"I want to attack the philosopher Habeck on his elitist demeanor. The Greens are led by academics and their policies ignore the concerns of ordinary people. They do not represent the average working-class German!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4513, \"fields\": {\"question\": 804, \"description\": \"I want to hit Habeck on remarks he made about me on Twitter - his rants about me are unprofessional, and harmful for our democratic process. Questioning the loyalty to our constitution should be directed at the political extremes, not towards the parties of the democratic center.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4514, \"fields\": {\"question\": 804, \"description\": \"While Habeck himself seems to be a clean guy, his co-party leader Annalena Baerbock not only fumbled in her CV and plagiarized in her book, she also reported her earning far too late. A party that is led by such careless personalities should not lead Germany!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4515, \"fields\": {\"question\": 804, \"description\": \"Let’s stay on message and campaign in a positive way. This campaign isn’t won with attacks, but by convincing people that I am the best choice for chancellor!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4054, \"fields\": {\"question\": 731, \"description\": \"The pandemic has shown how ill-prepared our schools are. We need to continue improving digital infrastructure in education, through more training, technical assets and a national educational platform. That is what the CDU/CSU has worked on, and will continue doing.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4055, \"fields\": {\"question\": 731, \"description\": \"Actually, we don’t have much to gain by talking about this topic - many voters see us as responsible for the current situation. Let’s downplay it as much as we can and focus on issues where we are seen as more competent, like matters of security or debt.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4056, \"fields\": {\"question\": 731, \"description\": \"We definitely need to modernize the digital infrastructure of Germany, especially in the public sector. Administrative matters have to be more accessible to citizens, we need to digitize all internal processes and cut down on bureaucracy.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4057, \"fields\": {\"question\": 731, \"description\": \"Digitalization is a key issue - we need a digital transformation offensive. I want to especially emphasize that we will accomplish a nationwide 5G mobile network by 2025 and provide 15 billion Euros for Gigabit-networks. To that end, we will also establish a Ministry of Digital Innovation and Transformation.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4516, \"fields\": {\"question\": 805, \"description\": \"We need to alleviate the housing market by building more. We need to build more than 100.000 housing units, using tax benefits. We should also provide funding to revitalize our cities and villages, advertise rural spaces and reduce the real estate transfer tax - every family should be able to own a home.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4517, \"fields\": {\"question\": 805, \"description\": \"We need to emphasize the creation of more social housing, built by modern standards available for those who need it most. For families, we can make buying empty buildings in the countryside easier for young people, as they do in NRW. Furthermore, we need to fight land speculation and close tax loopholes.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4518, \"fields\": {\"question\": 805, \"description\": \"The situation is tense. It’s clear that action is needed in the form of rent controls. A sharper, unlimited federal rent control program should be introduced. In places where the situation is very problematic, we stand for a so-called ‘rent moratorium’, where rent would only be able to increase with the inflation rate.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4519, \"fields\": {\"question\": 805, \"description\": \"We are vehemently against programs like rent controls. Social housing projects have failed to improve the situation - instead we need to support low income renters through housing subsidies. Regulations have to be cut back, we need slimmer bureaucracies and faster approval processes so that the market can sort itself out.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4058, \"fields\": {\"question\": 732, \"description\": \"The most important thing we can do right now is help the affected regions with their crisis management. They need help now, quickly and unbureaucratically. I’m promising swift support.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4059, \"fields\": {\"question\": 732, \"description\": \"This has been an incredible wake-up call of nature. We have to evaluate what we can do to prepare for events like this in the future. For now, helping the victims has the highest priority.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4060, \"fields\": {\"question\": 732, \"description\": \"First, we need to quickly and diligently help the affected regions with the cleanup operations. After that, we have to guarantee financial emergency aid for affected people, unequivocally.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4061, \"fields\": {\"question\": 732, \"description\": \"Extreme weather events are unfortunately going to become more common due to climate change. We have to do a lot more than we are doing now. This might be expensive, but the costs of doing nothing are much, much higher.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4062, \"fields\": {\"question\": 733, \"description\": \"Actually, I don’t want to be seen as performative. The cleanup operations can be left to professionals, I will keep coordinating the crisis efforts from the state chancellery so that everything goes smoothly - that’s the best I can do for the victims.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4063, \"fields\": {\"question\": 733, \"description\": \"Of course, I want to get out there! I have to go in there with the rescue teams; I want to be seen as a man of action, with rubber boots, and shovels and all. Get me some cameras, and some impactful photos with the local fire departments.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4064, \"fields\": {\"question\": 733, \"description\": \"Of course, I want to get out there! But we’re running a national campaign, I want to visit other states as well and show off the competency of my CDU colleagues. Maybe some meetings with Kretschmer in Saxony, Bouffier in Hessen, and especially with my former opponent Laschet in NRW, to mend fences and show that we’re a united front.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4065, \"fields\": {\"question\": 733, \"description\": \"Of course, I want to get out there! I have to be a good leader in these times, and part of that is being seen by people. I love my home, and I hate to see my fellow citizens be stripped of their homes. Let’s focus our visits on Bavaria though, to not be seen as too power-hungry. Maybe some interviews with local media, nothing big.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4066, \"fields\": {\"question\": 734, \"description\": \"The floods have shown that we need to be much more ambitious than before. One of the worst offenders is our energy production: we need to stop using coal for energy generation by 2030 and seek out new innovative technologies to keep energy affordable.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4067, \"fields\": {\"question\": 734, \"description\": \"Climate change is coming, whether we want it or not. The most important thing we can do is mitigate its worst effects to prevent catastrophes like this from doing too much damage - we need better crisis responses. Climate action is necessary, as long as it doesn't stifle our economy and freedom of living\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4068, \"fields\": {\"question\": 734, \"description\": \"Why get head over heels with a statement? Let’s wait until Habeck says something, then respond to him in co-opting the more popular parts of his program, while criticizing bans and other incursions into people’s personal lives. We know what polls well and what doesn’t, let’s use that to our advantage!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4069, \"fields\": {\"question\": 734, \"description\": \"We are in an energy crisis - we need renewable energies, clearly. However, if you want to take climate change seriously, you have to agree: we are reliant on nuclear power. Exiting now would be foolish. We’re risking blackouts and the loss of jobs.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4070, \"fields\": {\"question\": 735, \"description\": \"We need a long term strategy for Covid, but a universal vaccine mandate might not be doable constitutionally. Maybe a sort of staggered plan for group-based vaccine mandates could lead us to our goal. Certain institutions that have entered a duty to serve this country.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4071, \"fields\": {\"question\": 735, \"description\": \"While I wouldn’t go that far, as we might run into legal issues, we should give people more incentives to get vaccinated. One solution might be to open up certain establishments from the lockdown, but only for vaccinated and recovered people.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4072, \"fields\": {\"question\": 735, \"description\": \"Covid is basically over, the case numbers are very low. One has to be honest and ask: Do we even need such an expensive program? Vaccines are good to have, but we should focus on opening up and treating Covid as the non-problem it has become.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4073, \"fields\": {\"question\": 735, \"description\": \"We need a vaccine mandate, as soon as possible. A partial mandate is not enough - Germany is the Covid problem child of Germany. At the end of the day, we have to have a long term strategy, and that heavily involves vaccinations.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4074, \"fields\": {\"question\": 736, \"description\": \"I mean, in the end, the whole thing with the Maut just went horribly wrong, and was a real problem. That’s just a pity. It wasn’t a sole CSU or Scheuer-project though!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4075, \"fields\": {\"question\": 736, \"description\": \"Actually, the project only failed because the EU sabotaged it. We need accountability from the European community, and carefully reevaluate our relationship and contributions.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4076, \"fields\": {\"question\": 736, \"description\": \"Andi really screwed this up - we have to drop him. I’ll publicly criticize him for his incompetence and make it clear there will be no political post for him in my government. When being asked if he should resign, we’ll defer to the parliamentary investigation committee.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4077, \"fields\": {\"question\": 736, \"description\": \"It’s true that we didn’t manage to get the highway toll through during the last four years - but it’s clear that our highways are still too overcrowded. With me as chancellor, I promise that we will get a Maut done in the next four years!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4520, \"fields\": {\"question\": 806, \"description\": \"Cannabis is a societal reality, like alcohol. We should start to take steps towards a regulated distribution to adults, accompanied by addiction prevention measures. The possession of small amounts shouldn’t be prosecuted anymore.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4521, \"fields\": {\"question\": 806, \"description\": \"We are against the legalization of illegal drugs. The risks for the individual and society are too great - instead, we should work towards addiction prevention, as well as early and suitable sanctions, that incentivise taking counseling and therapy. We do acknowledge the medical usage of Cannabis, however.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4522, \"fields\": {\"question\": 806, \"description\": \"Legalize it! We are for permitting the controlled distribution of Cannabis, through regulated sales in licenced shops. We do need projects to prevent drug abuse and youth protection though, financed through consumption taxes, as well as a legal framework around marihuana usage.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4523, \"fields\": {\"question\": 806, \"description\": \"Not at all: we need to further pursue drug users and lower the amount of cannabis that is legally prosecuted. Our goal is a drug free society. Look at the Netherlands, they have decriminalized the possession of just 5 grams, with fatal consequences - that won’t happen to our children.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4078, \"fields\": {\"question\": 737, \"description\": \"We will talk with all democratic parties - the SPD, the Greens and the FDP. However, I want to needle the leftist parties for not ruling out a coalition with the extremist Left. They are fringe populists, unfit to govern.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4079, \"fields\": {\"question\": 737, \"description\": \"We rule out coalitions with the extremes. Normally we would talk with everyone in the center, but it’s clear how a continuation of the Grand Coalition of the last 8 years would not have a public mandate. We need to find a different governing majority: I’d prefer Black-Green, or a Jamaica Coalition with the Greens and FDP.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4080, \"fields\": {\"question\": 737, \"description\": \"The last few years have shown how we can not ignore the 10-15% of the populace voting for the AfD. This country needs change and new solutions. I think a Bahamas coalition with the AfD and the FDP could work - our neighbor Austria showed us how the right wing can govern harmonically.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4081, \"fields\": {\"question\": 737, \"description\": \"Jamaica, Bahamas… All these coalition names make me want to take a holiday in the Caribbean.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4524, \"fields\": {\"question\": 807, \"description\": \"While §218 is a settled compromise from our societal discussions, we are for striking the §219a ad ban: women who are deciding on an abortion need unrestricted access to information. We also need to train more doctors and prevent pressure from abortion opponents in front of clinics.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4525, \"fields\": {\"question\": 807, \"description\": \"We want to strike $218, 219 and 219a from the books completely. Pregnancy issues are not part of criminal law - abortion is a medical service that has to be managed as part of regular health care. The stigma has to be broken, and the supply of doctors offering abortion has to be increased.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4526, \"fields\": {\"question\": 807, \"description\": \"The current situation is fine as is. Unborn life does have a right to be protected. Furthermore, the ad ban has already been loosened two years ago, to provide better access to information for affected women and legal certainty for doctors and hospitals, if an abortion is necessary.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4527, \"fields\": {\"question\": 807, \"description\": \"The right to life does not stand to disposition. The unborn child has a right to live, and we stand vehemently against efforts to trivialize or encourage abortions from the state. Instead, adoption procedures should be simplified - while doctors who do not report abortions have to incur noticeable sanctions.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4082, \"fields\": {\"question\": 738, \"description\": \"Afghanistan is the biggest blowback for the West since Vietnam. Of course, our government does not shed a good light, and the EU is too speechless - we quickly need a unified European position now. The USA has the main responsibility here, that’s where the decision for this retreat was made. We need a NATO-Special Session.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4083, \"fields\": {\"question\": 738, \"description\": \"It’s a disgrace how so many good people would now have to live under civil strife and a possible Taliban takeover. We at least have to take in those who cooperated with our troops - we owe it to them for their service. We should also further support the UN refugee agency financially.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4084, \"fields\": {\"question\": 738, \"description\": \"A big part of those responsible in our government should not keep their positions after the election. Specifically, Foreign Minister Heiko Maas of the SPD is clearly to blame the most. Just saying “Sorry, we misjudged” does not suffice! He should have started the evacuations much earlier, and there should be direct repercussions for his position.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4085, \"fields\": {\"question\": 738, \"description\": \"We can’t have a repeat of the refugee crisis of 2015. We need to take in some refugees, yes, but more clearly, we need to accept that there have to be upper limits and contingents for immigration  – we can not safe the whole world. We need to massively limit the fallout of this situation by securing our borders.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4086, \"fields\": {\"question\": 739, \"description\": \"Olaf Scholz is struggling in the polls, but he’s still our main competitor for a lot of voters with his wannabe-Merkel attitude. It seems foolish to do anything but attack him on his many weaknesses.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4087, \"fields\": {\"question\": 739, \"description\": \"Habeck is a strong candidate, and my main opponent for the chancellorship. But he isn’t invulnerable - and with the right tone, we could sweep some of his voters right from under his feet. Let’s focus on him.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4088, \"fields\": {\"question\": 739, \"description\": \"I will leave petty attacks to my opponents and focus more on policy. I’m certain the German people will appreciate hearing concrete solutions to their problems more than attacks. This isn’t America.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4089, \"fields\": {\"question\": 739, \"description\": \"Actually, I don’t want two left-wing politicians to gang up on me. This format is not up to the times and I can guarantee, time will not be allotted fairly to the only conservative party at the table. Thus, I must decline this invitation.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4090, \"fields\": {\"question\": 740, \"description\": \"He likes to present himself as a moderate, but he hasn’t completely ruled out a coalition with the extremist Left party. Can voters really trust him not to form this coalition after the election?\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4091, \"fields\": {\"question\": 740, \"description\": \"Let’s hit him on his scandals as finance minister. Under his watch, Wirecard collapsed due to fraudulent dealings and lots of people lost their money. We need to poke attention to the police raid on a government office belonging to his ministry - he refuses to take responsibility.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4092, \"fields\": {\"question\": 740, \"description\": \"Scholz likes to pretend he’s a moderate, but the program of his party is very leftwing, especially regarding pensions and the minimum wage. It shows that the SPD as a whole is unfit to govern, and a symbol of past days.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4093, \"fields\": {\"question\": 740, \"description\": \"Actually, I’ve changed my mind. The mudslinging isn’t worth it - after giving my usual critiques I’ll just wing it and rely on my instincts as a populist to rise above the pack.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4094, \"fields\": {\"question\": 741, \"description\": \"Robert Habeck lacks the character to be chancellor. His background is elitist and unrelatable, he goes on childish rants on twitter and he egregiously pushed away his female co-party chair from the top-post.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4095, \"fields\": {\"question\": 741, \"description\": \"Everyone on this stage agrees that something has to be done about climate change, but what Mr Habeck and his party want can’t be the solution! Don’t get it wrong: you have to be affluent to vote Green. I am worried that Germany would lose jobs and fall behind under a chancellor Habeck - the CDU/CSU is the true party of the environment.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4096, \"fields\": {\"question\": 741, \"description\": \"I’ll attack him for his willingness to govern with the radical Left party. Moderates should be frightened by this prospect, there should be a firewall against Radicals of all stripes, and entertaining a coalition with the Left, as the Greens do, is irresponsible.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4097, \"fields\": {\"question\": 741, \"description\": \"Actually, I’ve changed my mind. The mudslinging isn’t worth it - after giving my usual critiques I’ll just wing it and rely on my instincts as a populist to rise above the pack.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4098, \"fields\": {\"question\": 742, \"description\": \"The CSU is the party of climate action - we founded the first environmental protection Ministry in all of Germany, in 1970. We need a new push in talking climate, moving away from coal and towards regenerative energy with a concrete plan of action - I have the economic competence to lead us through this crisis without tempo limits or flight bans.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4099, \"fields\": {\"question\": 742, \"description\": \"With two left-leaning politicians debating with me, I will present myself as the voice of reason. We’re not in an ideological bubble - politics need to take care of the political center. We need a strong state when talking about security, and a liberal and worldly state when talking about the people’s quality of life. This is the compass to the future.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4100, \"fields\": {\"question\": 742, \"description\": \"Bavaria is the most successful state in Germany. We have low unemployment and offer good opportunities. Bavaria works - I will do the same to Germany. My administration will both be a continuity of the efficiency of the Merkel years and a new start.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4101, \"fields\": {\"question\": 742, \"description\": \"Actually, screw this! I know they won’t hold back, so I won’t either. We have enough ammunition to show Habecks and Scholz’ incompetence, and I shouldn’t be afraid to use it. That way, I can sharpen my profile and show myself as the most competent candidate.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4528, \"fields\": {\"question\": 808, \"description\": \"Let's hope Ziemiak gets me some good headlines.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4529, \"fields\": {\"question\": 808, \"description\": \"Let's hope Ziemiak gets me some good headlines.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4530, \"fields\": {\"question\": 808, \"description\": \"Let's hope Ziemiak gets me some good headlines.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4531, \"fields\": {\"question\": 808, \"description\": \"Let's hope Ziemiak gets me some good headlines.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4102, \"fields\": {\"question\": 743, \"description\": \"It’s important that all wings of our party stay united and motivated to vote. Let’s campaign with Friedrich Merz to show that I’m taking people like him and his positions seriously - the CDU/CSU has a clear profile, and I’m proud to stand with him for our values!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4103, \"fields\": {\"question\": 743, \"description\": \"Who else but Chancellor Angela Merkel could be the right person? She is a figure larger than life, an electoral juggernaut who has won the last four contests, and I want to show people that I’m the one to build on her legacy.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4104, \"fields\": {\"question\": 743, \"description\": \"No matter what happens, we have to make sure the right-wing demagogues do not increase their vote shares. I’m worried about the AfD taking first place in some East German states, and direct mandates could go to them: I need to campaign broadly in the New States, with local colleagues like Haseloff and Kretschmer.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4105, \"fields\": {\"question\": 743, \"description\": \"Armin Laschet, party leader of the CDU and my past rival, could help me mobilize voters in North Rhine-Westphalia, the most populous state. I want to burry the hatched and show how the Union is united to win this election once again!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4106, \"fields\": {\"question\": 744, \"description\": \"Now, it’s time for payoff. I’m sure Laschet will try to force a vote by the party elites - I’m going to welcome this, he’ll be surprised by how much support I have even among them. If even the upper CDU echelons stand with me against him, there will be nothing in my way.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4107, \"fields\": {\"question\": 744, \"description\": \"During the next few days, I will hammer my main argument again and again - I have the better polling numbers, and I’m the one who can lead the CDU/CSU to victory in the fall. I   will showcase several district candidates who are already distancing themselves from Laschet. He would lose, him and the rest of the party have to accept this.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4108, \"fields\": {\"question\": 744, \"description\": \"The party parliamentary group of CDU and CSU shall vote on this. They want to get reelected - with my strong numbers, I’m confident they’ll see me as the better option and pick me over Laschet.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4109, \"fields\": {\"question\": 744, \"description\": \"The party parliamentary group of CDU and CSU shall vote on this. They want to get reelected - with my strong numbers, I’m confident they’ll see me as the better option and pick me over Laschet.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4110, \"fields\": {\"question\": 745, \"description\": \"Now, it’s time for payoff. I’m sure Laschet will try to force a vote by the party elites - I’m going to welcome this, he’ll be surprised by how much support I have even among them. If even the upper CDU echelons stand with me against him, there will be nothing in my way.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4111, \"fields\": {\"question\": 745, \"description\": \"During the next few days, I will hammer my main argument again and again - I have the better polling numbers, and I’m the one who can lead the CDU/CSU to victory in the fall. I   will showcase several district candidates who are already distancing themselves from Laschet. He would lose, him and the rest of the party have to accept this.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4112, \"fields\": {\"question\": 745, \"description\": \"The party parliamentary group of CDU and CSU shall vote on this. They want to get reelected - with my strong numbers, I’m confident they’ll see me as the better option and pick me over Laschet.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4113, \"fields\": {\"question\": 745, \"description\": \"The party parliamentary group of CDU and CSU shall vote on this. They want to get reelected - with my strong numbers, I’m confident they’ll see me as the better option and pick me over Laschet.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4532, \"fields\": {\"question\": 809, \"description\": \"I stand by my moderate credentials, I am a proud Christian Democrat. However, we are competing with two left-wing alternatives: in order to win a strong mandate, we need to return to some of my leftwing pivots from the past - they are what brought me success.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4533, \"fields\": {\"question\": 809, \"description\": \"The CDU/CSU are the parties of the center. We have done a great job at governing over the last 16 years, and while we need to move into the future, our future is a Christian-Democratic one. I stand by my course.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4534, \"fields\": {\"question\": 809, \"description\": \"Friedrich Merz has tapped into a surprisingly large voter potential in 2018: Merkel-sceptic conservatives. The chancellor has become popular with voters of the other parties - for us, some of her policies are a bit more controversial. On these issues, we definitely need to move rightwards - to provide for a real alternative to the Greens and SPD.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4535, \"fields\": {\"question\": 810, \"description\": \"I stand for what I think is right, but it’s become clear to me we need to defuse ourselves. Let’s reconcile with the CDU and Merkel - so that their supporters won’t defect to the Liberals, or even our opponents.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4536, \"fields\": {\"question\": 810, \"description\": \"Yes. I stand for what I believe is right in this country, and it’s clear how we need a change in attitude in Germany to stay competitive. Our standing in the world is decreasing, and we need to work towards improving our country to be the best it can be, because we are patriots.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4537, \"fields\": {\"question\": 810, \"description\": \"Look - chancellor Merkel is a competent woman who I respect. But the fact of the matter is, her policies have tilted leftwards, both socially and economically. What our country needs in the post-Merkel era are policies more in line with conservative doctrines - the AfD’s success has shown that. If anything, we need to come back to our roots and move this country to the right.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4538, \"fields\": {\"question\": 730, \"description\": \"While the results in Saxony-Anhalt are definitely praiseworthy, me and my surrogates should focus on my main contender, Robert Habeck. We’re running a national campaign - and directly dealing with our opponent might be better.\"}}]");
